`updatetime` DATETIME NOT NULL Comment "更新时间",
PRIMARY KEY (`id`)) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci AUTO_INCREMENT = 6 ROW_FORMAT = Dynamic COMMENT = "医生信息表";
-- hol_examination DDL
CREATE TABLE `hol_examination` (`id` BIGINT NOT NULL AUTO_INCREMENT Comment "主键ID",
